import React from "react";
import { Navbar, Button, Table } from "react-bootstrap"; // Import Table from react-bootstrap
import { useNavigate } from "react-router-dom";
import Logo from "../../Images/Logo1.png";

function QA() {
  const navigate = useNavigate();

  const handleLogout = () => {
    navigate("/");
  };

  return (
    <div>
      <Navbar>
        <img src={Logo} alt="Logo" className="logo-1" />
        <Button
          variant="transparent"
          className="logout-btn"
          onClick={handleLogout}
        >
          Logout
        </Button>
      </Navbar>

      <div className="sidebar">
        <ul>
          <li>Home</li>
          <li>Services</li>
          <li>Options</li>
          <li>About Us</li>
          <li>Contact Us</li>
        </ul>
      </div>

      <div className="projects-table">
        <h2>Projects</h2>
        <Table striped bordered hover>
          <thead>
            <tr>
              <th>Project Name</th> {/* Project Name heading */}
            </tr>
          </thead>
          <tbody>
            {/* You can add table rows here */}
          </tbody>
        </Table>
      </div>
    </div>
  );
}

export default QA;
